// SPDX-License-Identifier: UNLICENSED

pragma solidity 0.8.19;


contract Father{
	string LastName = "Kim";
	string FirstName = "Gilsung";
	uint256 money = 100;
    
	constructor (string memory firstname) {
		FirstName = firstname;
	}
	function getMoney() view public virtual returns(uint256)  {
		return money;
	}

}
//상속은 아래와 같이 is를 사용함. 
// 아버지의 생성자를 통해 FirstName이 변경된 contract을 만들 수 있음.
contract Son is Father("Junbeum") { 
    uint256 earns = 200;

	function getMoney() view public override returns(uint256)  {
		return money+earns;
	}
}

// 또는 자식의 constructor에서 부모 생성자를 사용할 수도 있음.
contract Dauther is Father {
	constructor () Father("selim") {
	}
}

contract HelloWorld {

    uint256[] balance = [1, 2, 3];

    function push(uint i) public {
        // Append to array
        // This will increase the array length by 1.
        balance.push(i);
    }

	function test() public returns(uint256[] memory) {
		push(4);
		push(5);
		return balance;
	}
	
}


contract add{
    uint256 public num = 0;
    event Info(address _addr,uint256 _num);
    
    function plusOne() public {
        num = num + 1;
        emit Info(msg.sender,num);
    }
    

    
}

contract caller{
    uint256 public num = 0;
    function callNow(address _contractAddr) public payable{
        (bool success,) = _contractAddr.call(abi.encodeWithSignature("plusOne()"));
        require(success,"failed to transfer ether");
    }
    function delcateCallNow(address _contractAddr) public payable{
        (bool success,) = _contractAddr.delegatecall(abi.encodeWithSignature("plusOne()"));
        require(success,"failed to transfer ether");
    }
}
